import React from "react";
import styled from "styled-components";
import steypLogo from '../../assets/images/steyp-logo.svg'
import LineBg from '../../assets/images/lines-bg.svg'
import { type } from "@testing-library/user-event/dist/type";
import { Link, Outlet } from "react-router-dom";

function Registration() {

  return (
    <>
      <Spotlight>
        <Sleft>
            <Img1>
                <Steyp
                src={steypLogo}
                />
            </Img1>
            <H1>Apply for Admission</H1>
            <P8>Steyp's Engineering program is only for students who qualifies
                Steyp's eligibility test
            </P8>
            <ImageBox>
                <Ma src={require("../../assets/images/Mammookka.png")} />
            </ImageBox>
            
        </Sleft>
        <Sright>
            <H2>Steyp's Applicant Form</H2>
            <P1>
                Welcome back! Enter the details that your entered during
                registration
            </P1>
            <Form>
                <Label>Full Name*</Label>
                <Input10 placeholder="Enter Full Name" required/><Ab/>
                <Mains>
                    <MLeft>
                        <Label>Date of Birth *</Label><Ab/>
                        <Input21 type="date" placeholder="DD-MM-YYYY" required/>
                    </MLeft>
                    <MRight>
                        <P>Phone Number *</P>
                        <Div6 className="main"> 
                            <Br/>
                            <Div1>
                                <Div2 className="country-img">
                                    <Img3
                                        src={require("../../assets/images/india.png")}
                                        alt="flag"
                                    />
                                </Div2>
                                <Div className="country-code">+91</Div>
                                <Input1 type="number" placeholder="Enter Phone Number" required/>
                            </Div1>
                        </Div6>
                    </MRight>
                </Mains>
                <Radio1>
                    <P>Are you a</P>
